//src/components/CancelarAtendimento.js
import React from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';

const CancelarAtendimento = () => {
    const { id } = useParams();

    const handleDelete = () => {
        axios.delete(`/atendimento/cancelar?id=${id}`)
            .then(response => alert('Atendimento cancelado com sucesso'))
            .catch(error => console.error('Erro ao cancelar atendimento:', error));
    };

    return (
        <div>
            <h1>Cancelar Atendimento</h1>
            <button onClick={handleDelete}>Confirmar Cancelamento</button>
        </div>
    );
};

export default CancelarAtendimento;
